import React from 'react';

import { CustomButtonContainer} from './custom-button.style';


const CustomButton = (props) => (
    <CustomButtonContainer
        className={`
        ${inverted ? 'inverted' : ''}
        ${isGoogleSignIn ? 'google-sign-in' : ''} 
        custom-button `}
        {...otherProps}
    >
        {children}
    </CustomButtonContainer>
);


export default CustomButton;
